import React from 'react';
import './RecValue.css';


const RecValue = props => {
    function renderData() {
        return props.concepts.map(item =>
            <tr key={item.id}>
            
                
            <td>{item.name}</td>
            <td>{item.value} </td>

            </tr>
            )
    }
        return (
            
            <div>
                <table>
            <tbody id="content">
                <tr>
                    <th>Name</th>
                    <th>Email</th> 
                </tr>
                {item.name}
            </tbody>
        </table>
            {renderData()}
            </div>
            
        )
    }


export default RecValue;
